    return (

        <> {/* Tag for making a React fragment */}

        <article className="App-article">

            <h2>Locateb a store near you.</h2>
            <StoreTable stores={stores} />
            <ZipSearch />

        </article>

        </>

    );

}

export default StoresPage;
